import React from "react";
import Card1 from "../main/components/Card1";
import Card2 from "../main/components/Card2";
import Card3 from "../main/components/Card3";

const Hero = () => {
  const backgroundStyle = {
    backgroundImage: `url('images/Vector.png')`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };

  return (
    <div style={backgroundStyle} className="h-[675px]" id="hero">
      <div className=" container flex justify-center items-center">
        <div className="flex flex-col mt-40 items-center">
          <span className="relative">
            <img src="images/icon 2.png" alt=" logo" />
          </span>
          <span className="text-white text-5xl absolute mt-8 text-center">
            Access Innovative <br />
            Healthcare
          </span>
          <span className="text-white absolute mt-44 contrast-75 text-center">
            Empowering primary care professionals to seamlessly identify and
            engage <br /> with eligible patients for clinical trail
            opportunities.
          </span>
          <button className="bg-white text-[#392B85] absolute mt-64 px-8 py-4 text-center rounded">
            Contact Us
          </button>
        </div>
      </div>
      <div className="flex justify-center mt-44 gap-6">
        <Card1 />
        <Card2 />
        <Card3 />
      </div>
    </div>
  );
};

export default Hero;
